import styled from "styled-components";


export const LoginStyled = styled.div`
  display: flex;
  flex-direction: column;
  width: 43%;
  justify-content: space-between;
  background-color: azure;
  border-radius: 7px;
  border: #001529;
  padding: 35px 20px 35px 20px;
  height: 75%;
  
`
